import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const MyWalletScreen = () => {
  return (
    <View>
      <Text>MyWalletScreen</Text>
    </View>
  )
}

export default MyWalletScreen

const styles = StyleSheet.create({})
